    public static final String[] titleList = {"德法向世卫组织追加资金支持，合计增加 6.4 亿欧元", "国家卫健委：对在常态化防控措施之外附加其他不合理限制要求的要立即予以纠正", "​塞内加尔总统萨勒因接触新冠肺炎确诊病例进行两周自我隔离", "北京大兴一名60岁女子确诊，前四次核酸检测为阴性", "确诊外卖小哥的妻子和小孩核酸阴性"};
