    public static final String[] contentList = {"世卫组织举行记者会，世卫组织总干事谭德塞、德国卫生部长施潘、法国卫生部长韦朗共同出席。德国卫生部长施潘表示，全球健康和支持世卫组织是关键主题，现在比以往任何时候都需要一个强大、透明和负责任的世卫组织。德国今年将提供创纪录的总额超过 5 亿欧元的世卫资金支持。法国也将投入 1.4 亿欧元支持世卫。", "卫健委在《关于做好精准健康管理推进人员有序流动的通知》中提出：各地要按照依法、科学、精准防控要求，规范人员健康管理措施。对在常态化防控措施之外附加其他不合理限制要求的，要立即予以纠正。对造成恶劣影响的典型案例，坚决依法查处，并通过媒体予以曝光。", "塞内加尔国家通讯社塞通社（APS）当地时间25日报道，塞内加尔总统马基·萨勒因接触过一名新冠肺炎确诊病例，虽然萨勒总统的新冠病毒检测结果呈阴性，但作为预防措施，其决定从6月24日起进行为期两周的自我隔离。", "6月25日，在北京市新冠肺炎疫情防控工作新闻发布会上，北京市疾病预防控制中心副主任庞星火通报北京大兴一名60岁女子确诊，前四次核酸检测为阴性。", "饿了么 25日发布微博称，6月23日，一名小哥被确诊新冠，很多人对此表达了关心与祝福。目前，小哥正在医院隔离治疗，他的妻子和小孩都已经通过了核酸检测，结果都呈阴性，目前还在集中隔离观察。饿了么还称，已为北京全部骑手进行新冠疫情险延保。"};
